import React from "react";
import styled from "styled-components";

const Navbar = styled.nav`
  display: flex;
  align-items: center;
  justify-content: space-between;
  overflow: hidden;
  background: #5f191b;
  width: 100%;
`;

const Dropdown = styled.div`
  overflow: hidden;
`;

export { Navbar };
